import React from "react";
import { Outlet } from "react-router-dom";
import { FaSearch } from "react-icons/fa";

function Main() {
  return (
    <div>
      <section className="grid grid-cols-7 w-screen h-screen bg-[#222E35]">
        <div className="col-span-2 bg-[#111B21] w-full h-full grid grid-rows-6 border-r border-gray-500">
          <section className="w-full bg-[#222E35] row-span-1 grid grid-rows-3 ">
            <div className="flex flex-space-between p-4 items-center">
              <div className="bg-white rounded-full w-10 h-10"></div>
            </div>
            <div className="bg-[#111B21] p-2 py-2">
              <section className="bg-[#222E35] w-full h-10 rounded-xl px-5 p-2 text-white flex-row flex items-center justify-between">
                <FaSearch className="text-gray-400" />
                <input
                  type="text"
                  className="w-[80%] bg-transparent font-light text-sm"
                  placeholder="Search or Start New Chat"
                />
              </section>
            </div>
            <div className="h-[50px] overflow-auto">
              {index.map((items, index) => {
                return (
                  <div className="bg-[#111B21] grid grid-col-5 h-fit">
                    <section className="col-span-1"></section>
                    <section className="col-span-4 border-b border-gray-500">
                      {items}
                    </section>
                  </div>
                );
              })}
            </div>
          </section>
        </div>
        <div className="col-span-3 w-full h-full">
          <Outlet />
        </div>{" "}
      </section>
    </div>
  );
}

export default Main;
